   528→            const showResultsButton = document.getElementById('showResultsButton');
   529→
   530→            if (!introSection || !testContainer || !resultContainer || !statementContainer) {
   531→                console.error('Required DOM elements not found');
   532→                return;
   533→            }
   534→
   535→            // State variables
   536→            let currentQuestionIndex = 0;
   537→            let questions = questionsData.questions;
   538→            let answers = {
   539→                A: 0,
   540→                B: 0,
