   565→                    <div class="statement-pair">
   566→                        <button class="statement button" data-choice="A" role="radio" aria-checked="false" tabindex="0">
   567→                            ${question.statementA}
   568→                        </button>
   569→                        <button class="statement button" data-choice="B" role="radio" aria-checked="false" tabindex="0">
   570→                            ${question.statementB}
   571→                        </button>
   572→                    </div>
   573→                `;
   574→                
   575→                // Update progress text and bar
   576→                const progressPercent = ((currentQuestionIndex + 1) / questions.length) * 100;
   577→                progressText.textContent = `Frage ${currentQuestionIndex + 1} von ${questions.length}`;
