   614→                    selectedButton.setAttribute('aria-label', `Ausgewählt: ${selectedButton.textContent.trim()}`);
   615→                    
   616→                    if (currentQuestionIndex === questions.length - 1) {
   617→                        // Show results button on last question
   618→                        showResultsButton.classList.remove('hidden');
   619→                    } else {
