   642→                testContainer.classList.add('hidden');
   643→                resultContainer.classList.remove('hidden');
   644→                
   645→                // Find primary and secondary love languages
   646→                const sortedResults = Object.entries(answers)
   647→                    .sort(([,a], [,b]) => b - a)
   648→                    .map(([category, score]) => ({
   649→                        category: questionsData.categories[category],
   650→                        score: score
