   521→            const resultContainer = document.getElementById('resultContainer');
   522→            const statementContainer = document.getElementById('statementContainer');
   523→            const startButton = document.getElementById('startButton');
   524→            const prevButton = document.getElementById('prevButton');
   525→            const resetButton = document.getElementById('resetButton');
   526→            const progressText = document.getElementById('progress');
   527→            const progressBar = document.getElementById('progressBar');
   528→            const showResultsButton = document.getElementById('showResultsButton');
   529→
   530→            if (!introSection || !testContainer || !resultContainer || !statementContainer) {
   531→                console.error('Required DOM elements not found');
   532→                return;
   533→            }
   534→
   535→            // State variables
   536→            let currentQuestionIndex = 0;
   537→            let questions = questionsData.questions;
   538→            let answers = {
   539→                A: 0,
   540→                B: 0,
   541→                C: 0,
   542→                D: 0,
   543→                E: 0
   544→            };
   545→
   546→            // Initialize the test
   547→            function initializeTest() {
   548→                console.log('Test is starting');
   549→                currentQuestionIndex = 0;
   550→                answers = { A: 0, B: 0, C: 0, D: 0, E: 0 };
   551→                
   552→                introSection.classList.add('hidden');
   553→                testContainer.classList.remove('hidden');
   554→                resultContainer.classList.add('hidden');
   555→                
   556→                updateQuestion();
   557→            }
   558→
   559→            // Update the current question display
   560→            function updateQuestion() {
   561→                if (!questions.length) return;
   562→                
   563→                const question = questions[currentQuestionIndex];
   564→                statementContainer.innerHTML = `
   565→                    <div class="statement-pair">
   566→                        <button class="statement button" data-choice="A" role="radio" aria-checked="false" tabindex="0">
   567→                            ${question.statementA}
   568→                        </button>
   569→                        <button class="statement button" data-choice="B" role="radio" aria-checked="false" tabindex="0">
   570→                            ${question.statementB}
   571→                        </button>
   572→                    </div>
   573→                `;
   574→                
   575→                // Update progress text and bar
   576→                const progressPercent = ((currentQuestionIndex + 1) / questions.length) * 100;
   577→                progressText.textContent = `Frage ${currentQuestionIndex + 1} von ${questions.length}`;
   578→                progressBar.style.width = `${progressPercent}%`;
   579→                
   580→                // Show results button only on last question
   581→                showResultsButton.classList.toggle('hidden', currentQuestionIndex !== questions.length - 1);
   582→                
   583→                // Update ARIA attributes
   584→                const progressBarContainer = document.querySelector('.progress-bar-container');
   585→                progressBarContainer.setAttribute('aria-valuenow', progressPercent);
   586→                
   587→                // Announce question change to screen readers using the container
   588→                const announcementContainer = document.getElementById('announcement-container');
   589→                announcementContainer.textContent = `Frage ${currentQuestionIndex + 1} von ${questions.length}`;
   590→
   591→                updateNavigation();
   592→            }
   593→
   594→            // Handle statement selection
   595→            function selectStatement(choice) {
   596→                const question = questions[currentQuestionIndex];
   597→                const category = choice === 'A' ? question.categoryA : question.categoryB;
   598→                
   599→                // Reset previous selections
   600→                const buttons = statementContainer.querySelectorAll('.statement');
   601→                buttons.forEach(btn => {
   602→                    btn.classList.remove('selected');
   603→                    btn.setAttribute('aria-checked', 'false');
   604→                });
   605→                
   606→                // Mark current selection
   607→                const selectedButton = statementContainer.querySelector(`[data-choice="${choice}"]`);
   608→                if (selectedButton) {
   609→                    selectedButton.classList.add('selected');
   610→                    selectedButton.setAttribute('aria-checked', 'true');
   611→                    answers[category]++;
   612→                    
   613→                    // Announce selection to screen readers
   614→                    selectedButton.setAttribute('aria-label', `Ausgewählt: ${selectedButton.textContent.trim()}`);
   615→                    
   616→                    if (currentQuestionIndex === questions.length - 1) {
   617→                        // Show results button on last question
   618→                        showResultsButton.classList.remove('hidden');
   619→                    } else {
   620→                        // Move to next question
   621→                        currentQuestionIndex++;
   622→                        updateQuestion();
   623→                    }
   624→                }
   625→            }
   626→
   627→            // Navigation function for going back
   628→            function goToPreviousQuestion() {
   629→                if (currentQuestionIndex > 0) {
   630→                    currentQuestionIndex--;
   631→                    updateQuestion();
   632→                }
   633→            }
   634→
   635→            // Update navigation button state
   636→            function updateNavigation() {
   637→                prevButton.disabled = currentQuestionIndex === 0;
   638→            }
   639→
   640→            // Evaluate the test results
   641→            function evaluateTest() {
   642→                testContainer.classList.add('hidden');
   643→                resultContainer.classList.remove('hidden');
   644→                
   645→                // Find primary and secondary love languages
   646→                const sortedResults = Object.entries(answers)
   647→                    .sort(([,a], [,b]) => b - a)
   648→                    .map(([category, score]) => ({
   649→                        category: questionsData.categories[category],
   650→                        score: score
   651→                    }));
   652→
   653→                if (sortedResults[0].score === sortedResults[1].score) {
   654→                    sortedResults[1].score -= 1; // Adjust the secondary score to avoid ties.
   655→                }
   656→
   657→                const resultsHtml = `
   658→                    <div class="results-content">
   659→                        <p>Ihre primäre Sprache der Liebe ist: <strong>${sortedResults[0].category}</strong></p>
   660→                        <p>Ihre sekundäre Sprache der Liebe ist: <strong>${sortedResults[1].category}</strong></p>
   661→                        <div class="scores">
   662→                            ${sortedResults.map(result => `
   663→                                <div class="score-item">
   664→                                    <span>${result.category}:</span>
   665→                                    <span>${result.score} Punkte</span>
   666→                                </div>
   667→                            `).join('')}
   668→                        </div>
   669→                    </div>
   670→                `;
   671→                
   672→                document.getElementById('results').innerHTML = resultsHtml;
   673→            }
   674→
   675→            // Event Listeners
   676→            startButton.addEventListener('click', initializeTest);
   677→            resetButton.addEventListener('click', initializeTest);
   678→            prevButton.addEventListener('click', goToPreviousQuestion);
   679→
   680→            // Add click event listeners for statement selection
   681→            statementContainer.addEventListener('click', (event) => {
   682→                const button = event.target.closest('.statement');
   683→                if (button) {
   684→                    const choice = button.dataset.choice;
   685→                    selectStatement(choice);
   686→                }
   687→            });
   688→
   689→            showResultsButton.addEventListener('click', evaluateTest);
   690→        }
   691→
   692→        // Wait for DOM to be fully loaded
   693→        if (document.readyState === 'loading') {
   694→            document.addEventListener('DOMContentLoaded', initializeDOMElements);
   695→        } else {
   696→            initializeDOMElements();
   697→        }
