import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { quizData } from '../data/quizData';
import { Answers } from '../types';

interface LocationState {
  answers: Answers;
}

const Results: React.FC = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const state = location.state as LocationState;

  if (!state || !state.answers) {
    navigate('/test');
    return null;
  }

  const { answers } = state;

  // Calculate results
  const sortedResults = Object.entries(answers)
    .sort(([, a], [, b]) => b - a)
    .map(([category, score]) => ({
      category: quizData.categories[category as keyof typeof quizData.categories],
      score,
      key: category
    }));

  // Ensure secondary score is different from primary
  if (sortedResults[0].score === sortedResults[1].score && sortedResults[1].score > 0) {
    sortedResults[1].score -= 1;
  }

  const handleRestart = () => {
    navigate('/test');
  };

  return (
    <div className="min-h-screen flex items-center justify-center px-4 py-8">
      <div className="max-w-2xl mx-auto w-full">
        <div className="bg-white rounded-lg shadow-xl p-8">
          <h1 className="text-3xl font-bold text-center text-gray-800 mb-8">
            Ihre Ergebnisse
          </h1>

          <div className="bg-gray-50 rounded-lg p-6 mb-6">
            <p className="text-lg mb-4">
              Ihre primäre Sprache der Liebe ist:{' '}
              <strong className="text-primary text-xl">{sortedResults[0].category}</strong>
            </p>
            <p className="text-lg">
              Ihre sekundäre Sprache der Liebe ist:{' '}
              <strong className="text-primary text-xl">{sortedResults[1].category}</strong>
            </p>
          </div>

          <div className="bg-secondary rounded-lg p-6">
            <h2 className="text-xl font-semibold mb-4">Detaillierte Punktzahl:</h2>
            <div className="space-y-2">
              {sortedResults.map((result) => (
                <div
                  key={result.key}
                  className="flex justify-between items-center bg-white p-3 rounded-lg"
                >
                  <span className="font-medium">{result.category}:</span>
                  <span className="font-bold text-primary">{result.score} Punkte</span>
                </div>
              ))}
            </div>
          </div>

          <button
            onClick={handleRestart}
            className="w-full mt-8 bg-primary hover:bg-primary-hover text-white font-semibold py-3 px-6 rounded-lg transition-colors duration-300"
          >
            Test neu starten
          </button>
        </div>
      </div>
    </div>
  );
};

export default Results;

