import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { quizData } from '../data/quizData';
import { Answers, LoveLanguageCategory } from '../types';

const Quiz: React.FC = () => {
  const navigate = useNavigate();
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [answers, setAnswers] = useState<Answers>({
    A: 0,
    B: 0,
    C: 0,
    D: 0,
    E: 0
  });
  const [showIntro, setShowIntro] = useState(true);

  const questions = quizData.questions;
  const currentQuestion = questions[currentQuestionIndex];
  const progressPercent = ((currentQuestionIndex + 1) / questions.length) * 100;

  const handleStart = () => {
    setShowIntro(false);
  };

  const handleAnswer = (choice: 'A' | 'B') => {
    const category = choice === 'A' ? currentQuestion.categoryA : currentQuestion.categoryB;

    setAnswers(prev => ({
      ...prev,
      [category]: prev[category as LoveLanguageCategory] + 1
    }));

    if (currentQuestionIndex === questions.length - 1) {
      // Navigate to results with the answers
      navigate('/results', { state: { answers } });
    } else {
      setCurrentQuestionIndex(prev => prev + 1);
    }
  };

  const handlePrevious = () => {
    if (currentQuestionIndex > 0) {
      setCurrentQuestionIndex(prev => prev - 1);
    }
  };

  const handleShowResults = () => {
    navigate('/results', { state: { answers } });
  };

  if (showIntro) {
    return (
      <div className="min-h-screen flex items-center justify-center px-4">
        <div className="max-w-2xl mx-auto bg-white rounded-lg shadow-xl p-8">
          <h1 className="text-3xl font-bold text-primary text-center mb-6">
            Die 5 Sprachen der Liebe
          </h1>
          <p className="text-lg text-gray-700 mb-4">
            Willkommen zum Test der 5 Sprachen der Liebe. Dieser Test wird Ihnen helfen, Ihre primäre Sprache der Liebe zu entdecken.
          </p>
          <p className="text-lg text-gray-700 mb-8">
            Wählen Sie bei jeder Frage die Aussage aus, die Sie am besten beschreibt.
          </p>
          <button
            onClick={handleStart}
            className="w-full bg-primary hover:bg-primary-hover text-white font-semibold py-3 px-6 rounded-lg transition-colors duration-300"
          >
            Test starten
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen flex items-center justify-center px-4 py-8">
      <div className="max-w-2xl mx-auto w-full">
        <div className="bg-white rounded-lg shadow-xl p-6 md:p-8">
          {/* Progress Bar */}
          <div className="mb-8">
            <p className="text-center text-gray-700 font-medium mb-3">
              Frage {currentQuestionIndex + 1} von {questions.length}
            </p>
            <div className="w-full bg-gray-200 rounded-full h-3">
              <div 
                className="bg-primary h-3 rounded-full transition-all duration-300"
                style={{ width: `${progressPercent}%` }}
              />
            </div>
          </div>

          {/* Questions */}
          <div className="space-y-4 mb-8">
            <button
              onClick={() => handleAnswer('A')}
              className="w-full text-left p-6 bg-white border-2 border-primary rounded-lg hover:bg-primary-light transition-colors duration-200"
            >
              {currentQuestion.statementA}
            </button>
            <button
              onClick={() => handleAnswer('B')}
              className="w-full text-left p-6 bg-white border-2 border-primary rounded-lg hover:bg-primary-light transition-colors duration-200"
            >
              {currentQuestion.statementB}
            </button>
          </div>

          {/* Navigation */}
          <div className="flex flex-col space-y-3">
            <button
              onClick={handlePrevious}
              disabled={currentQuestionIndex === 0}
              className={`w-full py-3 px-6 rounded-lg font-medium transition-colors duration-300 ${
                currentQuestionIndex === 0
                  ? 'bg-gray-300 text-gray-500 cursor-not-allowed'
                  : 'bg-gray-200 hover:bg-gray-300 text-gray-700'
              }`}
            >
              Zurück
            </button>
            {currentQuestionIndex === questions.length - 1 && (
              <button
                onClick={handleShowResults}
                className="w-full bg-primary hover:bg-primary-hover text-white font-semibold py-3 px-6 rounded-lg transition-colors duration-300"
              >
                Ergebnisse anzeigen
              </button>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Quiz;
